import React from "react";
import GoodScore from "./GoodScore";
import GetAdmission from "./GetAdmission";
import Contact from './Contact';
                                                                                                                                                                                
const Footer=()=>
{
    return(
    <>

<div className="containor" >
      <div className="row">
        <div className="col-sm-4" id="navbarColorid">
          
        
     <a className="nav-link linkcolor"  href={Contact}>Contact-Me </a>
   
   </div>
   <div className="col-sm-4" id="navbarColorid">
        <a className="nav-link linkcolor" to="#">How I get admission in pucit</a>
    </div>
    <div className="col-sm-4" id="navbarColorid">
        <a className="nav-link linkcolor" to="#">How to score good in entry test</a>
    </div>    
   
   
        
</div>
</div>




    </>
)}


export default Footer;
